import * as React from 'react';
import Grid from '@mui/material/Grid';
import {Box, Button, TextField, Typography} from '@mui/material';
import CheckCircleRoundedIcon from '@mui/icons-material/CheckCircleRounded';
import {useState} from 'react';
import Axios from 'axios';



export const MainPage =()=>{
  const [generateInputValue, setGenerateInputValue] = useState(null)
  const [tokenValidation, setTokenValidation] = useState(null)

  const getValidation = async () => {
    try {

      // Call the validateToken API with the generated token
      const validateResponse = await Axios.get('/api/validate', {
        params: { token: generateInputValue },
      });

      const isValidToken = validateResponse.data; // Assuming the API response contains token validation result

      if (isValidToken) {
        setTokenValidation(true)
        console.log('Generated token is valid');
      } else {
        setTokenValidation(false)
        console.log('Generated token is not valid');
      }
    } catch (error) {
      console.error('Error generating or validating token:', error);
    }
  };

  return(
    <Grid container
      sx={{ backgroundColor:'secondary.main', height:'100vh', width:'100vw', justifyContent:'center', alignItems:'center'}}>
      <Grid item container xs={12} justifyContent={'center'}  >

      <Grid item container xs={6} justifyContent={'center'} key={'generate'}  >
        <Grid item container xs={12} justifyContent={'center'} >
          <Typography variant={'h1'} >
            {'Generate Token'}
          </Typography>
        </Grid>
        <Grid item container xs={12} justifyContent={'center'} sx={{marginTop:'10px'}} >
          <Box maxWidth="400px" sx={{display: 'flex', alignItems: 'center',}}>
            <Typography variant={'h2'} >
              {'This section allows you to create a new token based on your chosen digits. Customize the available digits and click "Generate" to create a token.'}
            </Typography>
          </Box>
        </Grid>
        <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
          <TextField
            placeholder="1-2-3-4-5"
            variant="outlined"
            sx={{width:'400px'}}
            onChange = {(e) => {setGenerateInputValue(e.target.value);}}
          />
        </Grid>

        <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
          <Box  sx={{width:'400px', backgroundColor:'#0a253c', height:'53px', borderRadius:'4px',display: 'flex', alignItems: 'center', justifyContent:'center'}} >
            <Typography variant={'h2'} >
              {'Your generated Token'}
            </Typography>
          </Box>
        </Grid>

        <Grid item container xs={12} justifyContent={'center'} marginTop={'30px'} >
          <Button variant="contained"   >
            Generate
          </Button>
        </Grid>
      </Grid>

        <Grid item container xs={6} justifyContent={'center'} key={'validate'}  >
          <Grid item container xs={12} justifyContent={'center'} >
            <Typography variant={'h1'} textAlign={'center'}>
              {'Validate Token'}
            </Typography>
          </Grid>
          <Grid item container xs={12} justifyContent={'center'} sx={{marginTop:'10px'}} >
            <Box maxWidth="400px">
              <Typography variant={'h2'} sx={{ textAlign: 'center' }}>
                {'Use this section to check the validity of a token using the Luhn algorithm. Enter the token and click "Validate" to see if it\'s a valid token.'}
              </Typography>
            </Box>
          </Grid>
          <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
            <TextField
              placeholder="XXXX-XXXX-XXXX-XXXX"
              variant="outlined"
              onChange = {(e) => {setGenerateInputValue(e.target.value);}}
              sx={{width:'400px'}} />
          </Grid>
          <Grid item container xs={12} justifyContent={'center'} marginTop={'50px'}  >
            <Box  sx={{width:'400px', backgroundColor:'#0a253c', height:'53px', borderRadius:'4px',display: 'flex', alignItems: 'center', justifyContent:'center'}} >
              tokenValidation && {}
              <Typography variant={'h2'} >
                {'Input Token to validate'}
              </Typography>
            </Box>
          </Grid>

          <Grid item container xs={12} justifyContent={'center'} marginTop={'30px'} >
            <Button variant="contained" >Validate</Button>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
 }
